    const disabledStateKey = (disabledState as any)[event]
    if (disabledStateKey && node[disabledStateKey] === false) {
      return
    }
    node.state[event] = state
    if (targetId === node.id && pathIds.length === 0) {
      return
    }
    recCallNodes(state, event, node.nodes, pathIds)
  })
}

